interface IOwnable {
  function manager() external view returns (address);

  function renounceManagement() external;

  function pushManagement( address newOwner_ ) external;

  function pullManagement() external;
}

contract Ownable is IOwnable {

    address internal _owner;
    address internal _newOwner;

    event OwnershipPushed(address indexed previousOwner, address indexed newOwner);
    event OwnershipPulled(address indexed previousOwner, address indexed newOwner);

    constructor () {
        _owner = msg.sender;
        emit OwnershipPushed( address(0), _owner );
    }

    function manager() public view override returns (address) {
        return _owner;
    }

    modifier onlyManager() {
        require( _owner == msg.sender, "Ownable: caller is not the owner" );
        _;
    }


    function renounceManagement() public virtual override onlyManager() {
        emit OwnershipPushed( _owner, address(0) );
        _owner = address(0);
    }

    function pushManagement( address newOwner_ ) public virtual override onlyManager() {
        require( newOwner_ != address(0), "Ownable: new owner is the zero address");
        emit OwnershipPushed( _owner, newOwner_ );
        _newOwner = newOwner_;
    }

    function pullManagement() public virtual override {
        require( msg.sender == _newOwner, "Ownable: must be new owner to pull");
        emit OwnershipPulled( _owner, _newOwner );
        _owner = _newOwner;
    }
}

contract Tournament is Ownable {

    using SafeMath for uint256;
    using SafeERC20 for IERC20;

    address public immutable BUSD;
    address public DAO;
    address public tournamentManager;

    address public locker;
    uint public devisionSize;
    uint256 public ticketPrice;

    constructor ( 
        address _tournamentManager,
        address _DAO,
        address _BUSD, 
        uint _devisionSize,
        uint256 _ticketPrice
    ) {
        require( _DAO != address(0) );
        DAO = _DAO;
        require( _BUSD != address(0) );
        BUSD = _BUSD;
        tournamentManager = _tournamentManager;
        devisionSize = _devisionSize;
        ticketPrice = _ticketPrice;      
    }

    modifier onlyTournamentManager() {
        require( tournamentManager == msg.sender, "Ownable: caller is not the manager" );
        _;
    }


    function renounceTurnamentManagement(address _newManager ) external onlyTournamentManager() {
        tournamentManager = _newManager;
    }

    /**
        @notice stake OHM to enter warmup
        @param _amount uint
        @return bool
     */
    function buyticket( uint256 _amount) external returns ( bool ) {  
        require(ticketPrice <= _amount, "amount is less then the ticket price" );     
        IERC20( BUSD ).safeTransferFrom( msg.sender, address(this), _amount );
        return true;
    }

    function payWinners( address[] calldata _winners) external onlyTournamentManager() {  
    require(_winners.length > 0, "payWinners: Empty _winners");
    uint totalPrize = IERC20( BUSD ).balanceOf(address(this));
    uint winnerPrize = totalPrize.div(_winners.length);
       for (uint256 i; i < _winners.length; i++) {         
        IERC20( BUSD ).safeTransfer(_winners[i],winnerPrize);
        }  

    }
      /// @notice Get Deposit fee for Protocol
    function getDevisionSize() external view returns (uint) {
        return devisionSize;
    }

      /// @notice Get Deposit fee for Protocol
    function getTicketPrice() external view returns (uint) {
        return ticketPrice;
    }

    /// @notice Sets the new daoAddress
    /// @param _daoAddress The address to set as the new owner
    function setDAOAddress(address _daoAddress) public onlyTournamentManager() {
        require(_daoAddress != address(0), "setDAOAddress: daoAddress must not be empty");
        require(_daoAddress != DAO, "setDAOAddress: daoAddress must not be pre address");
        DAO = _daoAddress;
    }

    /// @notice Sets the new devisionSize
    /// @param _devisionSize The address to set as the new owner
    function setDevisionSize(uint _devisionSize) public onlyTournamentManager() {
        // require(_daoAddress != address(0), "setDAOAddress: daoAddress must not be empty");
        // require(_daoAddress != daoAddress, "setDAOAddress: daoAddress must not be pre address");
        devisionSize = _devisionSize;
    }

    /// @notice Sets the new ticketPrice
    /// @param _ticketPrice The address to set as the new owner
    function setTicketPrice(uint _ticketPrice) public onlyTournamentManager() {
        // require(_daoAddress != address(0), "setDAOAddress: daoAddress must not be empty");
        // require(_daoAddress != daoAddress, "setDAOAddress: daoAddress must not be pre address");
        ticketPrice = _ticketPrice;
    }
}

